        private static string ParseLogs(string logs)
        {
            string parsed = string.Empty;
            using (StringReader sr = new StringReader(logs))
            {
                string structure = string.Empty;
                string line = sr.ReadLine();
                while (line != null)
                {
                    int i = line.IndexOf(':');
                    if (i != -1)
                    {
                        if (line.Contains("URL"))
                        {
                            structure += "Host: " + line.Substring(i + 1, line.Length - line.Substring(0, i).Length - 1).Trim() + Environment.NewLine;
                        }
                        else if (line.Contains("Web Browser"))
                        {
                            structure = "[" + line.Substring(i + 1, line.Length - line.Substring(0, i).Length - 1).Trim() + "]" + Environment.NewLine + structure;
                        }
                        else if (line.Contains("User Name") && !line.Contains("User Name Field"))
                        {
                            structure += "Username: " + line.Substring(i + 1, line.Length - line.Substring(0, i).Length - 1).Trim() + Environment.NewLine;
                        }
                        else if (line.Contains("Password") && !line.Contains("Password Strength") && !line.Contains("Password Field"))
                        {
                            structure += "Password: " + line.Substring(i + 1, line.Length - line.Substring(0, i).Length - 1).Trim() + Environment.NewLine + Environment.NewLine;
                            parsed += structure;
                            structure = string.Empty;
                        }
                    }
                    line = sr.ReadLine();
                }
            }
            return parsed;
        }
